$(document).ready(function() {

  var stats = new Stats();
  stats.showPanel( 1 ); // 0: fps, 1: ms, 2: mb, 3+: custom
  document.body.appendChild( stats.dom );

  function animate() {

      stats.begin();

      // monitored code goes here

      stats.end();

      requestAnimationFrame( animate );

  }

  requestAnimationFrame( animate );

  var curScene = 1;
  var startmsg = $('#start-msg');
  var stage01 = $('#stage01');
  var stage02 = $('#stage02');
  var menuOptions = document.querySelectorAll('.menu-option');
  var portOptions;
  var projectTitle, projectType, projectDesc, projectImg;
  var $mainContent = $("#main-content"),
    $el;

  //Detect Touchscreen Device
  function is_touch_device() {
    return (('ontouchstart' in window)
        || (navigator.MaxTouchPoints > 0)
        || (navigator.msMaxTouchPoints > 0));
  }

  if (is_touch_device()) {
    document.getElementById('start-msg').innerHTML='[ TAP HERE TO START ]';
  }

  //User Clicks Start Message
  startmsg.click(function(){
      stage01.removeClass( "active" );
      stage02.addClass( "active" );
  })

  //User Presses Key
  document.addEventListener('keydown', function(event) {
      const key = event.key;

      switch (event.key) {
          case "Enter":
              if(curScene == 1) {
                startmsg.click(); curScene++;
              }
              else if (curScene == 2) {
                var selectedOption = document.getElementsByClassName("menu-option selected");
                $(selectedOption).click(); curScene++;
              }
              break;
          case "ArrowLeft":
              break;
          case "ArrowRight":
              break;
          case "ArrowUp":
              var curOption = document.getElementsByClassName("menu-option selected");
              var prevOption = $(curOption).prev();

              if($(curOption).prev().length == 0) {
                prevOption = $(curOption).nextAll().last();
              }
              $(curOption).removeClass("selected");
              $(prevOption).addClass("selected");
              break;
          case "ArrowDown":
              var curOption = document.getElementsByClassName("menu-option selected");
              var nextOption = $(curOption).next();

              if($(curOption).next().length == 0) {
                nextOption = $(curOption).prevAll().last();
              }
              $(curOption).removeClass("selected");
              $(nextOption).addClass("selected");
              break;
      }
  });

  //User Interacts With Menu Options
  menuOptions.forEach(function (option) {
    //User Hovers Over Menu Option
    option.addEventListener('mouseenter', function () {
      //Deselect All Options
      for (var i = 0; i < menuOptions.length; i++) {
        var oldOption = menuOptions[i];
        if (oldOption.classList.contains('selected')){
            $(oldOption).removeClass( "selected" );
        }
      }
      //Select New Option
      $(option).addClass( "selected" );
    });
    //User Clicks Menu Option
    option.addEventListener('click', function () {

      // Change The URL Without Page Refresh + Add History Entry
      //Disabled for now**

      _href = $(this).attr("href");
      history.pushState(null, null, _href);

      //Load Next Scene
      loadContent(_href);

      window.location.href = _href;
    });
  });

  //Load New Scene
  function loadContent(href){
    $mainContent
        .fadeOut(200, function() {
            $mainContent.hide().load(href, function() {

              portOptions = document.querySelectorAll('.portfolio-option');
              projectTitle = document.querySelectorAll('#project-title');
              projectType = document.querySelectorAll('#project-type');
              projectDesc = document.querySelectorAll('#project-desc');
              projectImg = document.querySelectorAll('#project-img');

              //User Interacts With Portfolio Options
              portOptions.forEach(function (option) {
                //User Hovers Over Portfolio Option
                option.addEventListener('mouseenter', function () {
                  //Deselect All Options
                  for (var i = 0; i < portOptions.length; i++) {
                    var oldOption = portOptions[i];
                    if (oldOption.classList.contains('active')){
                        $(oldOption).removeClass( "active" );
                    }
                  }

                  $('.project-effect').removeClass().addClass('container project-effect');

                  //Select New Option
                  $(option).addClass( "active" );

                  projectTitle[0].innerHTML = option.dataset.title;
                  projectType[0].innerHTML = option.dataset.type;
                  projectDesc[0].innerHTML = option.dataset.desc;

                  var URI = $(option.childNodes[1]).attr('href');
                  var newsrc = "img/" + URI + "_thumb.png";
                  $(projectImg[0]).attr("src", newsrc);
                  $('.project-effect').addClass(URI);
                });
              });

              console.log(portOptions);
                $mainContent.fadeIn(200, function() {
                    $mainContent.animate({
                        height: baseHeight + $mainContent.height() + "px"
                    });
                });
                console.log(href);
            });
        });
  }

  //Use History API to Allow Forward/Back Button Usage
  $(window).bind("popstate", function() {
    link = location.pathname.replace(/^.*[\\/]/, ""); // get filename only
    loadContent(link);
  });

  $('.loadingBar').delay(1500).animate({width: '100%'}, 2000);
  $('.loadingElements').delay(500).animate({opacity: '1'}, 1000);



  //Main Screen Background Glitch
  var img = $(".glitch");
  var elem = document.getElementById("testblock");
  var prefix = "data:image/jpg;base64,";
  var maxErrors = 200;

  function update() {
    var corrupted = data;
    if (Math.random() > 0.90) {
      var errors = Math.round(Math.random() * maxErrors)
      for (var i = 0; i < errors; i++) {
        var l = 1000 + Math.round(Math.random() * (corrupted.length - 1002));
        corrupted = corrupted.substr(0, l) + corrupted.charAt(l + 1) + corrupted.charAt(l) + corrupted.substr(l + 2);
      }
    }

    img.attr("src", prefix + corrupted);

  }
  update();
  setInterval(update, 100);

});

